Information
------------------------------

The Truth About Your Dog's Food
Dogs are man's best friend who we shower with care, love, affection and gifts, but how much of what we put into our pooch's food is actually good for them? What if through the attention we put into our canine's culinary delights we are actually making some massive mistakes? In an industry worth billions of pounds every year, there's a huge market for all kinds of dog foods. Be it commercial, vegetarian, raw meat or home-cooked meals, the British public continue to spend vast sums of their cash on their favourite pets, even in times of recession. Clearly, it's in the dog food industry's best interests to offer as much choice to the consumer as possible, but what is the BEST food to feed our pets?
With the rise of reported chronic health issues amongst dogs, along with the incontrovertible rise of obesity amongst our favourite pets, the next nutritional battle ground to be fought in the UK is over dog food. An increasing number of dog owners in the UK are beginning to question and challenge the major dog food manufacturers and are going it alone when it comes to their precious pooches diets.

